final class Solution {
    
    struct Point {
        let x: Int
        let y: Int
    }
    
    func shortestPathBinaryMatrix(_ grid: [[Int]]) -> Int {
        guard !grid.isEmpty, grid[0][0] == 0 else {
            return -1
        }
        
        var grid = grid
        var current = [Point(x: 0, y: 0)]
        let n = grid.count
        var depth = 1
        
        let offsets = [
            Point(x: 1, y: 1),
            Point(x: 1, y: -1),
            Point(x: -1, y: 1),
            Point(x: -1, y: -1),
            Point(x: 0, y: 1),
            Point(x: 1, y: 0),
            Point(x: -1, y: 0),
            Point(x: 0, y: -1)
        ]
        
        while !current.isEmpty {
            var next = [Point]()
            for p in current {
                if p.x == (n - 1), p.y == (n - 1) {
                    return depth
                }
                
                for offset in offsets {
                    let variant = Point(x: p.x + offset.x, y: p.y + offset.y)
                    guard variant.x >= 0, variant.x < n, variant.y >= 0, variant.y < n, grid[variant.x][variant.y] == 0 else {
                        continue
                    }
                    grid[variant.x][variant.y] = 1
                    next.append(variant)
                }
            }
            depth += 1
            current = next
        }
        
        return -1
    }
}

